import Button from '../../UI/Button';
import Input from '../../UI/Input';

const MealItemForm = () => {
  return (
    <form className={Style.form}>
      <Input type='number'/>
      <Button btnLabel='+ Add'/>
      <Button btnLabel='-'/>
    </form>
  )
}

export default MealItemForm
